import React, { useRef, useMemo, useEffect } from 'react';
import { Canvas, useFrame } from '@react-three/fiber';
import { Environment, Sparkles, MeshTransmissionMaterial } from '@react-three/drei';
import * as THREE from 'three';
import { createNoise4D } from 'simplex-noise';

const noise4D = createNoise4D();

const BaseBlob = ({ color, ...props }) => {
  const mesh = useRef();
  const material = useRef();
  const origPositions = useRef();
  const tRef = useRef(0);

  useEffect(() => {
    if (mesh.current) {
      const pos = mesh.current.geometry.attributes.position.array;
      origPositions.current = new Float32Array(pos);
    }
  }, []);

  useFrame(({ clock }) => {
    tRef.current += 0.01;
    const t = tRef.current;
    const geometry = mesh.current.geometry;
    const pos = geometry.attributes.position;
    if (!origPositions.current) return;

    for (let i = 0; i < pos.count; i++) {
      const ox = origPositions.current[i * 3];
      const oy = origPositions.current[i * 3 + 1];
      const oz = origPositions.current[i * 3 + 2];
      const len = Math.sqrt(ox * ox + oy * oy + oz * oz);
      const nx = ox / len;
      const ny = oy / len;
      const nz = oz / len;

      const noise = noise4D(nx * 1.5, ny * 1.5, nz * 1.5, t * 0.7);
      const amp = 0.12 + 0.18 * noise;
      const r = 1.2 * (1 + amp * 0.5);
      pos.setXYZ(i, nx * r, ny * r, nz * r);
    }
    pos.needsUpdate = true;
    geometry.computeVertexNormals();

    if (color) {
      material.current.color.set(color);
    }
  });

  return (
    <mesh ref={mesh} {...props}>
      <icosahedronGeometry args={[1.2, 64]} />
      <meshPhysicalMaterial
        ref={material}
        color={color || new THREE.Color('#FFD700')}
        roughness={0.08}
        metalness={0.6}
        transmission={0.7}
        thickness={1.1}
        ior={1.45}
        reflectivity={0.7}
        clearcoat={0.7}
        clearcoatRoughness={0.15}
        attenuationColor={new THREE.Color('#FFC300')}
        attenuationDistance={0.7}
        transparent
        opacity={0.98}
      />
    </mesh>
  );
};

const ColorShiftBlob = () => {
  const color = useMemo(() => new THREE.Color(), []);
  useFrame(({ clock }) => {
    const t = clock.getElapsedTime();
    color.setHSL((t * 0.1) % 1, 1, 0.5);
  });
  return <BaseBlob color={color} />;
};

const PulsatingCoreBlob = () => {
  const coreRef = useRef();
  useFrame(({ clock }) => {
    const t = clock.getElapsedTime();
    coreRef.current.intensity = (Math.sin(t * 2) + 1) * 0.5;
  });

  return (
    <>
      <BaseBlob />
      <pointLight ref={coreRef} position={[0, 0, 0]} color="#FFD700" distance={1} intensity={1} />
    </>
  );
};

const ShimmeringBlob = () => {
  return (
    <mesh>
      <icosahedronGeometry args={[1.2, 64]} />
      <MeshTransmissionMaterial
        transmission={1}
        roughness={0}
        thickness={0.2}
        ior={1.5}
        chromaticAberration={0.06}
        backside={true}
      />
    </mesh>
  );
};

const BlobDemo = () => {
  return (
    <div style={{ background: '#111', color: 'white', padding: '20px' }}>
      <h1>Blob Enhancement Demos</h1>
      <p>Navigate to <a href="/" style={{ color: '#409EFF' }}>/</a> to go back to the main interface.</p>
      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(2, 1fr)', gap: '20px' }}>
        <div>
          <h2>1. Dynamic Color Shifting</h2>
          <Canvas style={{ height: '400px', background: '#222', borderRadius: '10px' }}>
            <ambientLight intensity={0.8} />
            <pointLight position={[10, 10, 10]} intensity={1.5} color={'#fff8e1'} />
            <ColorShiftBlob />
            <Environment files="/env/city.hdr" />
          </Canvas>
        </div>
        <div>
          <h2>2. Particle Effects</h2>
          <Canvas style={{ height: '400px', background: '#222', borderRadius: '10px' }}>
            <ambientLight intensity={0.8} />
            <pointLight position={[10, 10, 10]} intensity={1.5} color={'#fff8e1'} />
            <BaseBlob />
            <Sparkles count={100} scale={2} size={6} speed={0.4} />
            <Environment files="/env/city.hdr" />
          </Canvas>
        </div>
        <div>
          <h2>3. Pulsating Core</h2>
          <Canvas style={{ height: '400px', background: '#222', borderRadius: '10px' }}>
            <ambientLight intensity={0.8} />
            <pointLight position={[10, 10, 10]} intensity={1.5} color={'#fff8e1'} />
            <PulsatingCoreBlob />
            <Environment files="/env/city.hdr" />
          </Canvas>
        </div>
        <div>
          <h2>4. Shimmering Surface</h2>
          <Canvas style={{ height: '400px', background: '#222', borderRadius: '10px' }}>
            <ambientLight intensity={0.8} />
            <pointLight position={[10, 10, 10]} intensity={1.5} color={'#fff8e1'} />
            <ShimmeringBlob />
            <Environment files="/env/city.hdr" />
          </Canvas>
        </div>
      </div>
    </div>
  );
};

export default BlobDemo;
